import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import $ from 'jquery'

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <App />
);

// Обработка загрузки страницы для скрытия ненужных элементов
window.onload = function () {
    $('.btn_window_container').hide();
    $('.black_block').hide();
    // addToFeed()

};
